import React from "react";

function Search({searchInput, setSearchInput}){
    return (
        <div className="search-bar">
            <input 
            type="text" 
            value={searchInput}
            onChange={(e) => setSearchInput(e.target.value)}
            />
        </div>
    )
}

export default Search;
